import React from "react";

export default function SignUp() {
  return (
    <div>
      <form>
        <div>아이디
            <input className="box-border h-8 w-40 p-4 border-4" type="text"></input>
        </div>
        <div>비밀번호</div>
        <div>비밀번호 재확인</div>
        <div>이름</div>
        <div>생년월일</div>
        <div>성별</div>
        <div>주소</div>
        <div>휴대전화</div>
        <div>가입하기</div>
      </form>
    </div>
  );
}
